test_text01 = "Helferich wuchs in Dortmund auf und bestand dort das Abitur. Nach dem Wehrdienst beim Wachbataillon der Bundeswehr in Siegburg begann Helferich 2009 ein Studium der Rechtswissenschaften an der Rheinischen Friedrich-Wilhelms-Universität Bonn.[2] Eine Reserveoffizierslaufbahn konnte er nicht beginnen.[3] Er trat der Bonner Burschenschaft Frankonia bei, aus der er 2021 ausgeschlossen wurde.[4] Ab Oktober 2011 setzte er sein Studium an der Ruhr-Universität Bochum fort.[2] Im Jahre 2015 bestand er die erste juristische Staatsprüfung am Oberlandesgericht Hamm. Helferich war im Anschluss als wissenschaftlicher Mitarbeiter an einem Lehrstuhl für Wirtschaftsrecht an der Ruhr-Universität Bochum und als Dozent für Staats- und Europarecht am Studieninstitut Ruhr für kommunale Verwaltung tätig.[2] Ab 2018 absolvierte er das Rechtsreferendariat in Dortmund, Düsseldorf, sowie Klagenfurt und bestand im Anschluss das zweite Juristische Staatsexamen am Landgericht Dortmund. Seit 2020 arbeitet er als Rechtsanwalt in Dortmund.[5] Helferich ist eigenen Angaben nach ledig und gehört der evangelischen Kirche an.[6]"
test_text02 = "Nach dem Abitur 1989 am Staatlichen Gymnasium Bad Bergzabern absolvierte Wissing ein Studium der Rechtswissenschaft an der Universität des Saarlandes in Saarbrücken und an der Albert-Ludwigs-Universität in Freiburg im Breisgau, welches er 1994 mit dem ersten juristischen Staatsexamen beendete.[1] Nach Ableistung des Referendariats 1996 und bestandenem zweiten Staatsexamen war er anschließend Leiter der Widerspruchsstelle der Sonderabfallmanagement Gesellschaft (SAM) GmbH in Mainz.[2] 1997 erfolgte seine Promotion zum Dr. jur. an der Universität Münster mit der Arbeit Überlassungspflichten begründende Gemeinwohlinteressen im System des Kreislaufwirtschafts- und Abfallgesetzes. Anschließend war er zuerst Richter beim Landgericht Zweibrücken im Justizdienst des Landes Rheinland-Pfalz und wechselte noch im Juli 1997 als Staatsanwalt an das Landgericht Landau in der Pfalz. Von März bis Dezember 1999 war er Richter am Amtsgericht Landau in der Pfalz. Von 2000 bis 2004 war Wissing abgeordnet als Persönlicher Referent des Justizministers von Rheinland-Pfalz Herbert Mertin (FDP). 2001 wurde er zum Richter am Landgericht ernannt. Wissing wurde am 23. Januar 2004 Mitglied des Deutschen Bundestages. Er rückte für Marita Sehn nach. Nach dem Ausscheiden aus dem Bundestag wurde Wissing am 27. Dezember 2013 zum Generalsekretär des Senate of Economy International ernannt, der internationalen Dachorganisation des „Senates der Wirtschaft“.[3] Er gründete 2014 die auf Wirtschaftsrecht, Wirtschaftsstrafrecht, Erbrecht und Vermögensnachfolge ausgerichtete Kanzlei „Wissing Rechtsanwälte“. Er kaufte 2014 auch die Erbrechtskanzlei Dr. Kerscher und Kollegen und integrierte sie in seine Kanzlei. Volker Wissing stammt aus einer calvinistischen Familie.[4] Er ist verheiratet und Vater einer Tochter. Die Familie besitzt ein Weingut.[5] Parallel zu seinem Abitur legte er die C-Prüfung als Kirchenmusiker ab. Er war jahrelang als Organist an der protestantischen Pfarrkirche (ehemals Sankt Oswald) in Heuchelheim-Klingen bei Gottesdiensten tätig.[6]"
