test_text04 = "Nach dem Abitur 1994 am Gymnasium Leopoldinum in Passau absolvierte Scheuer ein Lehramtsstudium an der Universität Passau, das er 1998 mit dem ersten Staatsexamen für das Lehramt an Realschulen beendete. Ein anschließendes Magisterstudium mit dem Hauptfach Politikwissenschaft und den Nebenfächern Soziologie und Wirtschaftswissenschaft schloss er 2001 ab (Titel der Abschlussarbeit: Wahlkampf der CSU – eine Betrachtung am Beispiel der Medientouren des Ministerpräsidenten und Parteichefs Dr. Stoiber).[1]Im Jahr 2004 wurde ihm an der Karls-Universität Prag für die unter Aufsicht von Rudolf Kučera erstellte Arbeit Die politische Kommunikation der CSU im System Bayerns der „kleine Doktorgrad“ der Philosophie verliehen. Dieser akademische Grad, der heute der sogenannten 2. Bologna-Stufe (Master-Ebene) zugehört,[2] ist heute im Gegensatz zu 2004[3] nicht mehr äquivalent zu einer Promotion, berechtigt seinen Inhaber aber zur Führung des Titels PhDr.[4] Dessen ungeachtet – und obwohl in Deutschland nur im Gebiet der Bundesländer Bayern[5] und Berlin[6] erlaubt[7][8] – stellte Scheuer seinem Namen bundesweit den Zusatz Dr. voran.[9] Als Dr. Andreas Scheuer bestritt er auch den Wahlkampf zur Bundestagswahl 2005.[1] Strafrechtliche Ermittlungen gegen Scheuer wegen möglichen Missbrauchs eines akademischen Titels wurden von der Staatsanwaltschaft Passau 2006 eingestellt.[10] Mitte Januar 2014 wurden gegen Scheuer Plagiatsvorwürfe erhoben. In seiner Arbeit zur Erlangung des PhDr. soll er eine längere Textpassage der Bundeszentrale für politische Bildung weitgehend übernommen haben, ohne dies kenntlich gemacht zu haben.[9][11] Nach der Berichterstattung über diese Unstimmigkeiten kündigte Scheuer an, vom Führen des Doktorgrades (sowohl „PhDr.“ als auch „Dr.“) zukünftig abzusehen.[12][13][14][15] Die Karls-Universität gab am 21. Januar 2014 bekannt, bei einer Plagiatsprüfung mittels Software keine verdächtigen Stellen in der Arbeit gefunden zu haben.[16] Anfang Oktober 2014 wies die Ethik-Kommission der Prager Universität die Plagiatsvorwürfe zurück. Scheuer habe laut weiterer Untersuchungen der Universität zwar drei Textpassagen ohne die notwendige Kennzeichnung übernommen, dies stelle jedoch keine systematische Täuschungsabsicht dar: „Im Kontext der gesamten Arbeit betrachtet die Kommission diese Abschnitte jedoch eher als eine Zusammenfassung und nicht als schwerwiegenden Verstoß gegen Ethik-Regeln.“ Scheuer teilte in diesem Zusammenhang mit, dass er weiterhin auf das Führen des PhDr. bzw. Dr. verzichten werde.[17][18]"
test_text05 = "Partei Scheuer trat 1994 in die Junge Union (JU) und die CSU ein. Er war von 1997 bis 2003 Vorsitzender des JU-Kreisverbandes Passau-Stadt und gehörte von 2001 bis 2007 dem Landesvorstand der JU-Bayern an. Von Dezember 2003 bis Juli 2007 war Scheuer Vorsitzender des JU-Bezirksverbandes Niederbayern. Er war stellvertretender Vorsitzender des CSU-Kreisverbandes Passau-Stadt und gehört seit 2001 dem CSU-Bezirksvorstand Niederbayern an. Von 2002 bis 2024 gehörte er dem Stadtrat von Passau an.[27][28] Er legte sein Mandat im Stadtrat nieder, nachdem vor dem Hintergrund seines Wirkens als Bundesminister zwei Stadtratsmitglieder Scheuers persönliche Eignung für einen Sitz im Rechnungsprüfungsausschuss des Stadtrates in Frage stellten.[29]Am 15. Dezember 2013 wurde Scheuer vom Parteivorstand einstimmig zum Generalsekretär der CSU gewählt.[30] Von März 2014 bis zum Ende dessen XIV. Amtsperiode im Juli 2016 war er Vertreter seiner Partei im ZDF-Fernsehrat.[31]Ab 2016 war er Vorsitzender des CSU-Bezirksverbandes Niederbayern. Anfang 2023 gab er bekannt, beim Bezirksparteitag am 8. Juli 2023 nicht mehr für eine Wahl zur Verfügung zu stehen.[32] Als sein Nachfolger wurde dort der bayerische Verkehrsminister Christian Bernreiter gewählt.[33]Als Abgeordneter und im BundeskabinettScheuer war von 2002 bis 2024 Mitglied des Deutschen Bundestages. Er zog 2002 über die Landesliste Bayern[34] sowie 2005, 2009, 2013, 2017 und 2021 als direkt gewählter Abgeordneter des Wahlkreises Passau in den Bundestag ein. Bei der Bundestagswahl 2005 erreichte er 58,5 %, 2009 46,5 %, 2013 59,8 %, 2017 47,5 % und 2021 30,7 % der Erststimmen.[35][36]Nach der Bundestagswahl 2009 war Scheuer im Kabinett Merkel II bis 2013 Parlamentarischer Staatssekretär beim Bundesminister für Verkehr, Bau und Stadtentwicklung Peter Ramsauer (CSU).[37]Scheuer war vom 14. März 2018 bis zum 8. Dezember 2021 Bundesminister für Verkehr und digitale Infrastruktur im Kabinett Merkel IV.[38]Im Januar 2024 erklärte er beim Neujahrsempfang der CSU Passau-Stadt, bei der Bundestagswahl 2025 nicht erneut anzutreten.[39][40][41] Zum 1. April 2024 legte er sein Mandat als Mitglied des Deutschen Bundestages vorzeitig nieder.[42] Für ihn gab es keinen Nachrücker, da sein Mandat als unausgeglichenes Überhangmandat nach § 48 Abs. 1 Satz 2 BWahlG a. F. verfiel."
