test_text08 = "Lindner wurde 1979 in Wuppertal geboren. Sein Vater, Wolfgang Lindner,[2] ist promovierter Mathematiker mit dem Schwerpunkt Computeralgebrasysteme im Unterricht und war als Oberstudienrat am Städtischen Gymnasium Wermelskirchen und als Lehrbeauftragter an der Fernuniversität in Hagen tätig.[3][4] Seine Mutter, Martina Lindner, gemäß Berichterstattung des Express später mit Familiennamen Hessling,[5] arbeitete als Pharma- und Klinikreferentin.[6] Nach der Trennung der Eltern wuchs Lindner laut Bild am Sonntag bei seiner Mutter in Wermelskirchen auf.[7] Das Abitur legte er 1998 nach eigener Angabe in einem Interview mit Kinderreportern der Rhein-Zeitung mit einem Notenschnitt von 1,3[8] am Städtischen Gymnasium in Wermelskirchen ab. Anschließend leistete Lindner Zivildienst als Hausmeister in der Theodor-Heuss-Akademie der Friedrich-Naumann-Stiftung in Gummersbach. Seine Motivation zur Verweigerung des Wehrdienstes bestand nach eigenen Aussagen darin, eine bereits 1997 begonnene unternehmerische Tätigkeit fortsetzen zu können. Die Entscheidung widerrief er später, als er sich als Reserveoffizier bewarb.[9] Von 1999 bis 2006 studierte er Politikwissenschaft als Hauptfach sowie Öffentliches Recht und Philosophie als Nebenfächer an der Rheinischen Friedrich-Wilhelms-Universität Bonn.[10] Nach elf Semestern erwarb er den akademischen Grad Magister Artium (M. A.).[11] Während des Studiums war Lindner Reserveoffizier bei der Luftwaffe.[12] 2002 wurde er zum Oberleutnant der Reserve befördert.[13] Als Reservist nahm er rund vier Jahre lang als Einsatztagebuchführer an Wehrübungen beim Luftwaffenführungskommando in Köln-Wahn teil.[14] Im Jahre 2008 wurde er Verbindungsoffizier zum Landeskommando Nordrhein-Westfalen in Düsseldorf.[14] Er führt den Dienstgrad Major der Reserve.[15]"
test_text09 = "Alexander Johann „Alex“ Möller war Sohn des Eisenbahnbeamten Alex Möller (Reichsbahnsekretär und späterer Mitbegründer der Reichsgewerkschaft deutscher Eisenbahnbeamten und -anwärter) und wurde ebenfalls Reichsbahnbeamter. Seine Mutter war eine geborene Kohlmaier. 1922 wurde er Mitglied der SPD. In Halle an der Saale wurde er ab Januar 1923 Bezirksleiter des Deutschen Eisenbahner-Verbandes (DEV), des späteren Einheitsverbandes der Eisenbahner Deutschlands (EdED). Zugleich übernahm er 1923 die Bundesleitung der Reichsgewerkschaft deutscher Eisenbahnbeamten und -anwärter in Berlin. Nach der Fusion der Reichsgewerkschaft mit dem DEV zum EdED übernahm Möller bis 1933 diese Funktion. Von 1928 bis 1933 vertrat er als jüngster Mandatsträger den Wahlkreis Halle-Merseburg im Preußischen Landtag. Mit Beginn der Machtübernahme der Nationalsozialisten wurde Möller verfolgt. Da er dem Gedanken eines politischen Generalstreiks gegen die beginnende NS-Herrschaft nahe stand, wurde er vom 3. Mai bis 22. Mai 1933 in sogenannte Schutzhaft in Halle an der Saale genommen. Danach stand er unter Polizeiaufsicht und war Repressalien der Gestapo ausgesetzt. Während der Zeit des Nationalsozialismus bestritt er seinen Lebensunterhalt als Versicherungsvertreter, zunächst bei der deutschen Niederlassung der international tätigen „Phoenix“, dann nach deren Verbot im Jahre 1936 bis 1944 im Außen- und Innendienst für die Karlsruher Lebensversicherungs AG. Er arbeitete sich bis zum Organisationschef und stellvertretenden Vorstandsmitglied hoch. Für kurze Zeit leitete er in Gotha einen Ausweichbetrieb der Karlsruher Lebensversicherungs AG."
test_text10 = "Franz Müntefering wurde im Januar 1940 als einziges Kind des Landwirts und Fabrikarbeiters Franz Müntefering und dessen Frau Anna Müntefering, geborene Schlinkmann, im sauerländischen Neheim (ab April 1941 Neheim-Hüsten) bei Arnsberg geboren. Er wuchs im nahegelegenen Sundern auf.[1][2] Erst im Alter von sechseinhalb Jahren lernte er seinen Vater kennen, als dieser aus der Kriegsgefangenschaft heimkehrte. Die Eltern starben beide 1985. Nach dem Besuch der Volksschule in Sundern absolvierte Müntefering von 1954 bis 1957 eine Ausbildung zum Industriekaufmann, anschließend war er bis 1975 in der metallverarbeitenden Industrie tätig und wurde 1967 Mitglied der Gewerkschaft IG Metall. 1961/1962 leistete er seinen Grundwehrdienst bei der Panzergrenadiertruppe in Höxter und Osterode am Harz ab."
test_text11 = "Joseph „Joschka“ Fischer wurde als drittes Kind des Metzgers József Fischer (1909–1966) und dessen Frau Erzsébet (Elisabeth) Fischer, geborene Sasvári, in Gerabronn geboren.[2] Vorfahren Fischers waren Metzger aus Friedingen und wanderten 1731 als Kolonisten nach Ungarn aus.[3] 1946 hatten Fischers Eltern mit ihren Töchtern Georgina (* 1939) und Franziska (* 1943) als Ungarndeutsche[4][5] ihren Wohnort Wudigeß (ungarisch Budakeszi, eine im Jahr 2000 zur Stadt erhobene Gemeinde nahe der ungarischen Hauptstadt Budapest) verlassen müssen.[6] Über Gaildorf in Württemberg kam die Familie zunächst nach Kirchberg an der Jagst und siedelte schließlich nach Langenburg im Hohenlohischen über, wo der Vater eine Metzgerei übernahm.[6] Der von Joschka Fischer geführte Vorname leitet sich von Jóska [joːʃkɔ] ab, einer Diminutivform des ungarischen Vornamens József [joːʒef] (deutsch Joseph). In der frühen Jugendzeit war Fischer Ministrant in seiner katholischen Heimatkirchengemeinde Oeffingen. Noch vor Beendigung der Untersekunda (10. Klasse) verließ er 1965 das Gottlieb-Daimler-Gymnasium in Stuttgart-Bad Cannstatt ohne Abschluss und begann in Fellbach eine Lehre als Fotograf, die er 1966 abbrach."
test_text12 = "Nach dem Besuch der Volksschule absolvierte Egon Franke eine Lehre zum Tischler und bildete sich anschließend an einer Kunstgewerbeschule zum Kunsttischler fort. 1929 trat Franke der SPD bei. Bis 1933 war er Vorsitzender der Sozialistischen Arbeiterjugend in Hannover."
test_text13 = "Aenne Engels stammte aus einem katholischen Elternhaus. Sie war die zweite Tochter des Reichsbahnbeamten Heinrich Engels und seiner Frau Käthe und wuchs in einem Arbeitervorort von Duisburg[1] in einer katholisch geprägten Großfamilie auf, zu der neben Eltern und Schwester noch die Großeltern, eine Urgroßmutter sowie 22 Tanten und Onkel gehören. Sie begleitete zusammen mit ihrer Schwester ihre Mutter, die Stadtverordnete von Duisburg für die Zentrumspartei war[2] und sich in der katholischen Frauenbewegung engagierte, oft bei deren Bemühungen in den Arbeitervierteln die größte Not nach dem Ersten Weltkrieg zu lindern. Zudem war Aenne Engels in der katholischen Jugendbewegung tätig und die Vorsitzende des Liebfrauenbundes in Duisburg, einer Vereinigung von Schülerinnen der von den „Schwestern unserer lieben Frau“ geleiteten Schulen.[3] Nach dem Abitur 1931 war sie von 1932 bis 1934 als Bildnerin in der Behindertenfürsorge tätig. Da sie aufgrund des politischen Engagements ihrer Eltern in der Zentrumspartei im nationalsozialistischen Deutschland nicht studieren konnte, ging sie 1934 nach Schottland, wo sie ein College in Glasgow besuchte.[3] Im Alter von 25 Jahren heiratete sie den Journalisten Werner Brauksiepe und folgte ihm nach Den Haag, wo er als Korrespondent der katholischen Kölnischen Volkszeitung tätig war.[4] Dort lebte sie mit ihm ab 1937. Brauksiepe betreute auch in Den Haag behinderte Kinder. 1943 kehrte sie nach Deutschland zurück und dort kam ihr einziges Kind, ein Sohn zur Welt.[1] Ihr Mann wurde zum Kriegsdienst eingezogen und kehrte erst 1946 zurück.[5] Sie war 1. Vorsitzende des deutschen Zweigs der „St. Joan’s International Social and Political Alliance“ und 2. Vorsitzende des Katholischen Deutschen Frauenbundes."

